$(function() {
    //画面解像度でviewport切替(タブレットやスマホで閲覧した場合向け)
    $(window).on("resize orientationchange", function (e) {
        var wsw = window.screen.width;
        if (wsw <= 1279) {
            //1279px以下の場合変更
            $("meta[name='viewport']").attr("content", "width=1280px");
        }else{
            $("meta[name='viewport']").attr("content", "width=device-width, initial-scale=1, user-scalable=no");
        }
    }).trigger("resize");

    //■＋ボタンでクローンしたコンテンツのdatetimepickerを起動
    $(document).on('click', '.pick-date,.pick-btn',function() {
        //日付入力フォーマットY/m/d自動(cleave.jsの設定)
        var cleave = new Cleave(this, {
            date: true,
            delimiter: '/',
            datePattern: ['Y', 'm', 'd']
        });

        //datetimepickerをドラッグ移動(jQuery tinyDraggable.jsの設定)
        $('.xdsoft_datetimepicker').tinyDraggable();
    });

    //■datetimepickerを起動
    $('.pick-date,.pick-btn').on('click',function(){
        //datetimepickerをドラッグ移動(jQuery tinyDraggable.jsの設定)
        $('.xdsoft_datetimepicker').tinyDraggable();
    });

    //■スライドメニューON/OFF
    $('.switch').on('click',function(){
        $('body').toggleClass('slide-menu-open');
    });

    //■ツールチップ機能 class="tt" title属性(popperjs＋jquery.powertip.min.jsの設定)
    $('.tt').tooltip();

    //■ページトップへ戻るボタン押した時
    $('#headback').on('click',function() {
        var speed = 400;
        var href= $(this).attr("href");
        var target = $('#headback' ? 'html' : href);
        var position = target.offset().top;
        $('body,html').animate({scrollTop:position}, speed, 'swing');
        return false;
    });

    //■ページトップへ戻るボタン表示（画面をスクロールさせた時に画面右下に表示）
    var topBtn = $('#headback');
    topBtn.hide();
    $(window).scroll(function () {
        if ($(this).scrollTop() > 100) {
            topBtn.fadeIn();
        } else {
            topBtn.fadeOut();
        }
    })

    //■一覧画面のチェックボックスを全選択-解除
    $('#allcheck').on('change', function() {
        $('.check').prop('checked', $(this).is(':checked'));
    });

    //■一覧画面のチェックボックスを全選択-解除（個別のチェックの状態を確認→全選択/解除をコントロール）
    $('.check').on('change', function() {
        if ($('.table-01 :checked').length == $('.table-01 :input').length){
            $('#allcheck').prop('checked', true);
        }else{
            $('#allcheck').prop('checked', false);
        }
    });

    //■apple風トグルスイッチONの場合class switch-on付与
    $('.toggle-switch input:checked').parents('label').addClass('switch-on');

    //■トグルスイッチ切り替え
    $(document).on('change', '.toggle-switch input', function() {
        if($(this).prop('checked')){
            $(this).parents('label').addClass('switch-on');
        }else{
            $(this).parents('label').removeClass('switch-on');
        }
    });

    //■jquery-datepicker対応版　datetimepickerのフィールドのvalueを空
    // datetimepickerのフィールドへvalueを空にする×ボタンを生成
    $('.pick-area').append('<a class="reset-value"><i class="fas fa-times-circle"></i></a>');
    // input[type="month"]のフィールドへvalueを空にする×ボタンを生成
    $('.pick-month-area').append('<a class="reset-value"><i class="fas fa-times-circle"></i></a>');

    //datetimepickerのフィールドのvalueを空にする×ボタンを押した場合空に
    $(document).on('click', '.reset-value', function(){
        // 入力欄が日付(yyyy/mm/dd)の場合
        var document = $(this).parents('.pick-area').find('input[type="text"]');
        if ($(this).parents('.pick-month-area').find('input[type="month"]').length > 0) {
            // 入力欄が月度(yyyy/mm)の場合
            document = $(this).parents('.pick-month-area').find('input[type="month"]');
        }
        // 入力項目(input[type="text"])が有効・無効のチェック
        // ※無効化されている場合は入力値をクリアしないようする
        if (document.prop('disabled') == false) {
            // 入力項目が有効である場合
            // 日付入力欄をクリア
            document.val('');
            // 変更イベントを発火させるために、日付入力欄にフォーカスを当てる
            document.focus();
        }
    });

    // 一覧画面のチェックボックスを全選択-解除
    $('.allcheck').on('change', function() {
        const table = $(this).closest('table');
        const allItemCheck = $(table).find('.check');
        const allItemChecked = $(table).find('input.check:checkbox:checked');
        let isChecked = false;

        if (allItemCheck.length === 1 || allItemCheck.length === allItemChecked.length) {
            isChecked = $(this).is(':checked');
        } else {
            isChecked = true;
        }
        allItemCheck.each(function() {
            if ($(this).attr('disabled') === undefined) {
                $(this).prop('checked', isChecked);
            }
        })
    });

    // 一覧画面のチェックボックスを全選択-解除（個別のチェックの状態を確認→全選択/解除をコントロール）
    $('.check').on('change', function() {
        if ($('.table-01 .sticky :checked').length == $('.table-01 .sticky :input').length) {
            $('.allcheck').prop('checked', true);
        } else {
            $('.allcheck').prop('checked', false);
        }
    });
});


